insert into diseases(name, description, created_at, updated_at) values
("Hepatiti", "Hepatiti viral duke përfshirë hepatitin A, hepatitin B dhe hepatitin C është një grup sëmundjesh të ndara që ndikojnë në mëlçi. Secili ka shenja të ndryshme dhe trajtimet perkatëse. Testimi në laborator mund të përcaktojë llojet e hepatitit." ,now(), now()),
("Diabeti", "Diabeti paraqet një sëmundje e cila mund të ndodhë kur pankreasi prodhon pak ose aspak insulinë ose kur trupi nuk i përgjigjet siç duhet insulinës. Diabeti mund të ndodhë nëse ka shumë pak ose pak oksigjen të prodhuar nga pankreasi ose nëse trupi nuk korrigjohet me saktësi me glukozë. Njerëzit me diabet kanë nevojë për menaxhimin e kësaj sëmundje.", now(), now()),
("Hipertensioni", "Hipertensioni (Tensioni i lartë) i gjakut  rritë rrezikun e sëmundjeve të zemrës dhe të veshkëve. Faktorët e rrezikut të hipertensionit përfshijnë obezitetin, pirja e alkoolit, pirja e duhanit dhe historia e familjes.", now(), now()),
("Lupus", "Sëmundja auto-immune Lupus ndodh kur sistemi imunitar është sulmuar dhe shkakton skuqje, dhimbje dhe dëmtim të indeve. Lodhja, parehatia, inflamacioni dhe skuqja  janë të gjitha shenja të lupus. Ka lloje të ndryshme Lupus dhe çdo situatë është e dallueshme. Simptomat tuaja mund të rriten me shpejtësi ose ngadalë. Disa mund të jenë të buta dhe disa mund të jenë serioze.", now(), now());
